import React, {memo} from 'react';
import styled from 'styled-components';

import mq from '../style/MediaQuery';

const HeaderContainer = styled.div`
    width:100%;
    height:120px;
    background-color: #fff;
    margin: 0 auto;

    .headerWrap{

    }
`;

const Header = memo(() => {
  return (
    <HeaderContainer>
      <div className='headerWrap'></div>
    </HeaderContainer>
  );
});

export default Header;
